■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>ネコの被害を軽減!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5198/9481bo-01.jpg" width="599" height="800"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">※動物の生活環境やテリトリー意識の違いにより、多少効果を発揮する日数は変わります。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"><tr><td width="600" valign="top"><div align="center"><img width="600" height="449" src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5198/9481bo-02.jpg"><br><font size="3">使用イメージ</font></div><br></td></tr></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">赤外線センサーでネコの動きをキャッチし、その動きに合わせて不快な変超音波を放射する事により、感知エリア内から遠ざけます。動物愛護の観点から、ネコを傷つけず1～2週間をかけて学習させ、被害を防ぐように設計されています。</font></td></tr></table><br><br> <table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><h1><font color="#333333" size="3">ねこよけ/ネコよけ/猫よけ/猫撃退/猫退治/猫対策</font></h1></td></tr></table><br> <span style="padding:0;margin:0;font-size:0;color:#fff;">fk094igrjs</span><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">赤外線センサーでネコの動きをキャッチし、その動きに合わせて不快な変超音波を放射する事により、感知エリア内から遠ざけます。動物愛護の観点から、ネコを傷つけず1～2週間をかけて学習させ、被害を防ぐように設計されています。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">W97.5×D96×H233mm</font><br><font color="#333333" size="-1">個装サイズ：25×20×14cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">約420g</font><br><font color="#333333" size="-1">個装重量：1100g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ABS樹脂</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">感知範囲:約100m2、直進約13m、左右約90度<br>電源:単一乾電池4本(別売)または別売ACアダプター(コード長:10m)<br>電池寿命:約1800回(マンガン電池)、1日10回の作動で約6か月<br>音圧:約105dB<br>周波数:約18～23KHz・変動式<br>スイッチ:スライド式、停止・電池確認・昼夜・夜間の4段階<br>モード:昼夜・夜間の2モード<br>防滴構造あり</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">付属品</font></td><td align="left"><font color="#333333" size="-1">固定用ベース板(ビス×5本)、可動式取付台(ネジセット付)、取扱説明書、保証書(保証期間:1年間)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
